import React from "react";
import Filas from "./Filas";

const Tabla = (props) => {
  const handleClick = () => {};
  return (
    <table className="table table-striped" style={{ width: "100%" }}>
      <thead>
        <tr>
          {props.cabeceras.map((cabecera) => (
            <th>{cabecera}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {props.prospectos.map((prospecto, index) => (
          <Filas
            onClick={this.handleClick()}
            key={prospecto._id}
            indice={index + 1}
            prospecto={prospecto}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Tabla;
